import DiaryEditor from "./DiaryEditor";
import DiaryList from "./DiaryList.js";
import './App.css';

const dummyList = [
  {
    id: 1,
    author: "조은정",
    content: "하이 1",
    emotion: 5,
    create_date: new Date().getTime()
  },
  {
    id: 2,
    author: "홍길동",
    content: "하이 1",
    emotion: 2,
    create_date: new Date().getTime()
  },
  {
    id: 3,
    author: "아무개",
    content: "하이 1",
    emotion: 1,
    create_date: new Date().getTime()
  },
]

const App = () => {
  return (
    <div className="App">
      <DiaryEditor />
      <DiaryList diaryList={dummyList} />
    </div>
  );
};

export default App;
